import {useState} from "react";
import "./styles.css"

export function Login(props){
    const [name, setName] = useState("")

    function handleNameOnChange(event){
        setName(event.target.value)
    }

    return (
        <div id={"tela-div"}>
            <div id={"login-info"}>
                <input type={"text"} value={name} onChange={handleNameOnChange} className={"login-input"}/>
                <input type={"text"} value={props.cpf}/>
            </div>
        </div>
    )
}
